        <TouchableOpacity style={styles.button}>
            <Text style={styles.text}>
                See Full Nutritional Composition
            </Text>
        </TouchableOpacity>
    </View>
  );
}


const styles = StyleSheet.create({
  container: {
    display: 'flex',
